  <Route>
    <Route path="/" element={<HomePage />} />
  </Route>
);
const router = createBrowserRouter(routeDefinitions);
*/

// http://example.com/
const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
  },
  {
    path: "/",
    element: <HomePage />,
  },
  {
    path: "/products",
    element: <ProductsPage />,
  },
]);
function App() {
  return <RouterProvider router={router} />;
}

export default App;
